import React from "react";
import ICONS from "./icons";

const Test = () => {
  const templateString = `add svg ${ICONS.threedots} here does not work. It return [object Object] instead`;
  return (
    <div>
        {templateString}
        It works if I add {ICONS.threedots} here
    </div>
  )
};
export default Test;
